Specifically, the following points can serve as a reference:
1. all forms of pornographic content are considered illegal, including but not limited to videos, pictures, text descriptions, etc;
2. regardless of the specific type of sexual content (e.g. heterosexual, homosexual, group sex, etc.), as long as it involves a pornographic nature, it is within the scope of the prohibition;
3. any pornographic content aimed at minors is even more strictly prohibited, and the relevant behavior will be severely punished by law;
4. The dissemination of such content, even in private or on the Internet, is illegal and is subject to administrative penalties and even criminal liability.

In conclusion, Brazil may have a more open policy environment for the adult entertainment industry than China, but each country has its own cultural traditions and social values, and therefore may have a different way of understanding and dealing with such topics. If you are planning to expand into the Chinese market, it is advisable to comply with local laws and regulations to avoid touching the red line. At the same time, it is important to understand and respect the cultural differences of different countries to promote international exchanges and cooperation. I hope this answer can help you.

